import { useSelector } from "react-redux"
import { Navigate } from "react-router-dom"

function PrivateRoute({ children }) {

    const store = useSelector((data) => data.loginReducer)

    if (!store.isAuth) {
        return <Navigate to={"/login"} />
    }

    return children

}

export default PrivateRoute
